import './App.css';
import {Header} from './component/header'
import {TopImage} from './component/top-image'
import {MainPage} from './component/mainpage'
import ReactDOM from 'react-dom';
import {Router,Route,IndexRoute,hashHistory, Routes} from 'react-router';
import { useState } from 'react';

function App() {
  return (
    <div className="App" id="App">
      <Router>
      <Routes>
        <Route path='/' element = {Story}></Route>
        <Route path='/asd' element = {Story1}></Route>
      </Routes>
      </Router>
      <Header/>
      <TopImage />
      <MainPage />
      <Home />
    </div>
  );
}


function Home () {
  const [history, setHistory] = useState()
  return (
    <Router history={history} >  
      <Route path='/' component={Story}>

          <Route path='/tabble' component={Story}></Route>
          <Route path='/label' component={Story}></Route>
          <Route path='/form' component={Story}></Route>
          <Route path='/carousel' component={Story}></Route>
          <Route path='/shop_home' component={Story}></Route>
          <Route path='/shop_home_detail' component={Story}></Route>
      </Route>  
  </Router>  
  )
}

function Story () {
  return (
    <div>
      456
    </div>
  )
}

function Story1 () {
  return (
    <div>
      789
    </div>
  )
}

export default App;
